Modern Marvels

History, Technology Documentary hosted by Bruce Nash, published by History Channel in 2002 - English narration


Information
------------------------------

Modern Marvels
Celebrating modern engineering excellence. This programme journeys back in time to take a look at some of the world's most incredible architectural masterpieces of all time, including marvels of staggering proportions. Hadrian's Wall, which stretches 74 miles long and is 2,000 years old, a tantalising treasure that historians are eager to explore further. London's Tower Bridge, a symbol of industrial might and technological daring. Gustave's Eiffel Tower, the very essence of Paris. San Francisco's Golden Gate Bridge, which fifty years after its construction is still regarded as one of the world's most incredible engineering accomplishments. One of the world's most ambitious engineering projects The Trans-Siberian Railway and the Empire State Building, synonymous with its home New York City.




6)  Golden Gate Bridge 
More than 50 years after its construction, the Golden Gate Bridge is still regarded as one of the world's great engineering marvels. Against all odds, it took 25 million man-hours and 80,000 miles of cable to complete and has become one of the greatest symbols of America. This is the awe-inspiring story of the Golden Gate Bridge.

